import styled from "styled-components";
import Motor from "../Motor/Motor";
import Usuarios from "../Usuarios/Usuarios";

const Card = styled.div`
margin-top: 50px;
left: 20px;
width: 400px;
height: 500px;
background-color: white;
`




function CardMotor(params) {
    return(
        <Card>
            <Usuarios/>
            <Motor/>
        </Card>
    )
}

export default CardMotor;
